    const handleSignupClick=() =>{
        setSignUp(!signUp)
    }

  return (

    <div >
      {signUp ? (
              <div>
                <SignUp handleSignupClick = {handleSignupClick}/>
              </div>
            ):(
              <div>
                <LogIn handleSignupClick = {handleSignupClick}/>
              </div>
            )} 
    </div>
  )}

export default App
